import ReactDOM from "react-dom";

import "./index.css";
import App from "./App";

ReactDOM.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />}>
        <Route index element={<Home />} />
        <Route path="teams" element={<Teams />}/>
      </Route>
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);
